var utilEmergence = function() {

	// VARS
	var	emergenceElement = $$("[data-emergence]"),
		emergenceIgnore = $$(".emergence-ignore"),
		emergenceIgnoreChild = $$(".emergence-ignore-child");
	
	
	// PROPERTIES
	if ( !$isMobile && !$hasTouch ) {

		TweenMax.set(emergenceElement.not(emergenceIgnore).children().not(emergenceIgnoreChild).not(anim).children(), {opacity: 0});

	}

	
	// OPTIONS
	emergence.init({
		container: window,
		reset: true,
		handheld: true,
		throttle: $updateInterval,
		elemCushion: 0,
		offsetTop: 0,
		offsetRight: 0,
		offsetBottom: 0,
		offsetLeft: 0,
		callback: function(element, state) {

			if ( state === "visible" ) {

				//console.log("Element is visible.");

				if ( !$isMobile && !$hasTouch ) {

					TweenMax.staggerTo($(element).not(emergenceIgnore).children().not(emergenceIgnoreChild).not(anim).children(), 0.5, {opacity: 1, delay: 0, ease: Power4.easeOut, overwrite: "false", clearProps:"all"}, 0.12);

				}

				//$(element).addClass("emergence-visible");
				$(element).find(anim).not(animInteract).addClass("anim-play");

			} else if ( state === "reset" ) {

				//console.log("Element is hidden with reset.");

				//$(element).removeClass("emergence-visible");
				$(element).find(anim).not(animInteract).removeClass("anim-play");

			} else if ( state === "noreset" ) {

				//console.log("Element is hidden with no reset.");

			}

	  }

	});

	
	// INIT
	emergence.engage();
	//emergenceReset();
	//emergence.disengage();

	
}; // END utilEmergence


